import React from "react";
import "./contact.css";

export default function ContactUs() {
  return (
    <div className="contact">
      <h1>Contact Us Here:</h1>
      <div className="contact-info">
        <p><span className="icon">&#x1F4CD;</span> Address: Pushtikar Society, Office #1, Dummy Apartment, Patel Estate Rd, opp. Dummy Park, Jogeshwari West, Mumbai, Maharashtra 400102</p>
        <p><span className="icon">&#x1F4DE;</span> Phone: 99999 88888</p>
      </div>
    </div>
  );
}
